import { NavLink } from "react-router-dom";

export default function SingleButton({ title, icon, path }) {
  return (
    <div className="element">
      <div className="icon">
        <img src={icon} className="" />
      </div>
      <div className="title">{title}</div>
    </div>
  );
}
